const Cv = ({tasks,seconds}) => {


  return (
    <>
    <div key={tasks.count} >
        <div className='name' >
            {tasks.text}
            </div>
            <div className='name'>
            {tasks.tel}
            </div>
            <div className='name'>
            {tasks.email} 
            </div>
            <div className='name'>
            {seconds.school}
            </div>
            <div className='name'>
            {seconds.title}
            </div>
            <div className='name'>
            {seconds.date}
            </div>
            <div className='name'>
            {seconds.finish}
            </div>

    </div>


    </>
  );
};

export default Cv;
